import { combineReducers } from "redux";
import { persistReducer} from 'red'

import userReducer from "./user/user-reducer.jsx";
import cartReducer from "./cart/cart.reducer.jsx";

export default combineReducers({
  user: userReducer,
  cart: cartReducer,
});
